// Obtendo o elemento de input e o elemento para exibir o resultado
const inputNumero = document.getElementById('numero');
const resultado = document.getElementById('resultado');

// Função para buscar a resposta no banco de dados simulado
function buscarResposta() {
    const numeroDigitado = inputNumero.value;
    const resposta = bancoDeDados[numeroDigitado];

    if (resposta) {
        resultado.textContent = resposta;
    } else {
        resultado.textContent = "Número não encontrado.";
    }
}

// Adicionando um event listener para o evento 'keypress'
inputNumero.addEventListener('keypress', (event) => {
    if (event.key === 'Enter') {
        buscarResposta();
    }
});


                
